css:
/**
 * Colors
 */
/**
 * Borders
 */
.sidebar-github-profile {
  margin-bottom: 20px;
}
.sidebar-github-profile a {
  text-decoration: none;
}
.sidebar-github-profile .pending {
  font-size: 12px;
  color: #87939a;
}
.sidebar-github-profile .logo {
  float: left;
  width: 15px;
  height: 15px;
  opacity: 0.4;
  margin-right: 7px;
}
.sidebar-github-profile .repo {
  padding-left: 14px;
  border-left: 1px solid #e6e6e6;
  margin-left: 7px;
  font-size: 12.04px;
  display: flex;
}
.sidebar-github-profile .repo a {
  overflow: hidden;
  text-overflow: ellipsis;
  flex: 1;
  white-space: nowrap;
}
.sidebar-github-profile .repo .stars {
  order: 2;
  margin-left: 14px;
}
.sidebar-github-profile h2 {
  font-size: 11px;
  font-weight: 600;
  text-transform: uppercase;
  color: #87939a;
  border-bottom: 1px solid #e6e6e6;
  margin: 2em 0 1em 0;
}
